import React from 'react';
// Font Awesome
import '../FontAwesome';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
function Header(){
    return(
        // <div className="background background-header"> 
        //     <div className="container header">
        //             <a href="/" className="header-logo">
        //                 <img src={process.env.PUBLIC_URL +"/logo.png"} alt="logo"></img>
        //             </a>
        //             <ul className="header-navbar">
        //                 <li><a href="/" className="header-navbar-link">HOME</a></li>
        //                 <li><a href="/" className="header-navbar-link">ITEM  <FontAwesomeIcon icon="angle-down"/></a></li>
        //                 <li><a href="/" className="header-navbar-link">PET <FontAwesomeIcon icon="angle-down"/></a></li>
