        //                 <a href="/"className="header-auth-link"> <FontAwesomeIcon icon="shopping-cart"/></a>
        //             </div>
                     
        //     </div>
        //     <div className="header-banner">
        //                 asddsaadsdsa
        //     </div>    
        // </div>
        <div className="container">
            div.header
            <nav className="nav-bar">
                <ul>
                    <li><img src={process.env.PUBLIC_URL +"/logo.png"} alt="logo" /></li>
                    <li>Home</li>
                    <li>Item <FontAwesomeIcon icon="angle-down"/></li>
                    <li>Pet <FontAwesomeIcon icon="angle-down"/></li>
                </ul>
            </nav>

        </div>
    )
};
export default Header;
